import * as React from 'react';
import { makeStyles, Avatar, Typography } from '@mui/material';

const useStyles = makeStyles((theme) => ({
  friendItem: {
    display: 'flex',
    alignItems: 'center',
    marginBottom: theme.spacing(2),
  },
  friendAvatar: {
    marginRight: theme.spacing(2),
  },
}));

const FriendList: React.FC = () => {
  const classes = useStyles();

  // Заглушки для списка друзей
  const friends = [
    { id: 1, name: 'John Doe', avatarUrl: 'https://example.com/avatar1.jpg' },
    { id: 2, name: 'Jane Smith', avatarUrl: 'https://example.com/avatar2.jpg' },
    { id: 3, name: 'Bob Johnson', avatarUrl: 'https://example.com/avatar3.jpg' },
  ];

  return (
    <div>
      <Typography variant="h6">Friends</Typography>
      {friends.map((friend) => (
        <div key={friend.id} className={classes.friendItem}>
          <Avatar src={friend.avatarUrl} alt={friend.name} className={classes.friendAvatar} />
          <Typography>{friend.name}</Typography>
        </div>
      ))}
    </div>
  );
};

export default FriendList;
